import { useTranslation } from "react-i18next";
import Card from "./Card/Card";
const Cards = () => {
    const { t, i18n } = useTranslation();
    const card = [
        {
            room: t("room1"),
            floor: t("floor1"), 
            size: "120 м", 
            price: "873 176,66 $",
            address: t("top-address1")
        }
    ]
    return(
        <div className="wrap">
           <Card room={t("room1")} floor={t("floor1")} size="120 м" price={"873 176,66 $"} address={t("top-address1")}/>
        </div>
    )
}
export default Cards;
